import React, { useState ,useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Header from "./Header";
import axios from 'axios';
import "bootstrap/dist/css/bootstrap.min.css";
var bg = { "background-color": "#99aab5" }


function Dashboard() {

 const [user, setUser]= useState([]);
 const [data,  setData]= useState([]);
 const navigate = useNavigate();

 useEffect(() => {
  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:4000/Route/index/profile');
      setData(response.data);
    } catch (error) {
      console.log(error);
    }
  };
  fetchData();
}, []);

  useEffect (() => {
    const userInfo = JSON.parse(localStorage.getItem("user-info"));
    setUser(userInfo);
    if (!userInfo){
      navigate("/");
    }
  },[navigate]);




  return (

  <>
    <Header/>
    <div> 
    <div className="text-center">
    <h1>Welcome To {user.fname}<br/> </h1>
    <h3>HOBBIES</h3>
   <h4>


    {user.hobbies && user.hobbies.map((hobbi,index) =>(
      <div key={index}>{hobbi}</div>
    ))}
    </h4>
    </div>
    </div>



    <div>

            <Popup trigger=
                {  <Button style={bg}> Feedback</Button>}
                position="right left">

      <div className="profile-container">
        <Form
         onSubmit={handleSubmit}
         >

          <h1>Feedback Page</h1>
          <FormGroup>
            <Label for="name">Name</Label>
            <Input type="text" name="name" id="name"
             value={name} onChange={handleChange} 
             placeholder="Enter Your Name" />
          </FormGroup>

          <FormGroup>
            <Label for="email">Email</Label>
            <Input type="email" name="email" id="email"
             value={email} onChange={handleChange} 
             placeholder="Enter Your Email" />
          </FormGroup>
          <FormGroup>
            <Label for="mobile">Mobile</Label>
            <Input type="number" name="mobile" id="mobile"
             value={mobile} onChange={handleChange} 
             placeholder="Enter Your Mobile" />
          </FormGroup>
          <FormGroup>

            <Label for="message">Message</Label>
            <Input type="textarea" name="message" id="message"
             value={message} onChange={handleChange} 
             placeholder="Enter Your Message" />

          </FormGroup>

          <Button style={bg}> Profile Save</Button>
        </Form>
      </div>

            </Popup>
        </div>


    </>

  )
};
export default Dashboard;
